import { FC } from "react";
import { twMerge } from "tailwind-merge";

export type ErrorGraphicProps = React.SVGProps<SVGSVGElement> & {
  type: ErrorGraphicType;
};
export type ErrorGraphicType = "unrecoverable" | "not-found" | "server";
export const ErrorGraphic: FC<ErrorGraphicProps> = ({
  type,
  className,
  ...props
}) => {
  const darkClassName = twMerge("hidden dark:block", className);
  const lightClassName = twMerge("block dark:hidden", className);

  switch (type) {
    case "unrecoverable":
      return (
        <>
          <UnrecoverableErrorDark {...props} className={darkClassName} />
          <UnrecoverableErrorLight {...props} className={lightClassName} />
        </>
      );
    case "not-found":
      return (
        <>
          <NotFoundErrorDark {...props} className={darkClassName} />
          <NotFoundErrorLight {...props} className={lightClassName} />
        </>
      );
    case "server":
      return (
        <>
          <ServerErrorDark {...props} className={darkClassName} />
          <ServerErrorLight {...props} className={lightClassName} />
        </>
      );
    default:
      throw new Error(`Unhandled error type ${type}`);
  }
};

